%[text] # Introduction to uDALES post-processing with MATLAB
%[text] This tutorial describes how to read and process facet data of the LES code uDALES using MATLAB. This tutorial introduces the `udbase` post-processing class. There are separate tutorials for processing field files and facet files.
%[text] The **`udbase`** post-processing class reads in most important input parameters, and contains a number of methods to load field and facet data.
%[text] **Field data:**
%[text] - **load\_stat\_xyt**. This method load the 1D slab- and time-averaged statistics from the file `xytdump.expnr.nc`. Several time-intervals may be present in the data.
%[text] - **load\_stat\_t**. This method loads the 3D time-averaged statistics from the file `tdump.expnr.nc`. Several time-intervals may be present in the data.
%[text] - **load\_stat\_tree**. This method loads the 3D time-averaged statistics of the tree source terms from the file `treedump.expnr.nc`. This method works exactly the same way as `load\_stat\_t`.
%[text] - **load\_field**. This method loads instantaneous 3D data from the file `fielddump.expnr.nc`. Several output times may be present in the data.
%[text] - **load\_slice**. This method loads instantaneous 2D slices of instantaneous 3D data from the file `Xslicedump.expnr.nc`. Several output times may be present in the data.
%[text] - **coarse\_graining**. This method applies spatial filtering to 3D field data using FFT-based convolution. Multiple filter sizes are applied simultaneously using physical length scales (meters) as input parameters.
%[text] - **merge\_stat\_cov**. This method merges short-time covariance statistics into longer-time averages by grouping time series data into non-overlapping windows. It computes windowed means and total covariance for two variables.
%[text] - **merge\_stat\_var**. This method merges short-time variance statistics into longer-time averages for a single variable. It is a specialized wrapper around `merge_stat_cov` for computing windowed means and variance. \
%[text] **Facet data:**
%[text] - **calculate\_frontal\_properties**. This method calculates the skylines, frontal areas and blockage ratios in the x- and y-direction.
%[text] - **plot\_fac\_type**. This method displays the type of surface for each facet.
%[text] - **assign\_prop\_to\_fac**. This method assigns a property of the facet type to each of the facets, so it can be used for calculation and visualisation
%[text] - **plot\_fac**. This method displays a surface variable on the mesh.
%[text] - **load\_fac\_momentum**. This method loads instantaneous momentum surface data from `fac.expnr.nc`. The first index is the facet id and second index is time.
%[text] - **load\_fac\_eb**. This method loads instantaneous surface energy balance data from `facEB.expnr.nc`. The first index is the facet id and second index is time.
%[text] - **load\_seb**. This method loads all instantaneous surface energy balance terms. The first index is the facet id and second index is time.
%[text] - **load\_fac\_temperature**. This method loads instantaneous facet temperature data `facT.expnr.nc`. The first index is the facet id, the second is the layer index and the third index is time.
%[text] - **area\_average\_seb.** This method calculates the area-averaged surface energy balance from the facet surface energy balances obtained using `load_seb`.
%[text] - **area\_average\_fac.** This method performs area-averaging over (a selection of) the facets. The facet index is assumed to be the first index of the array.
%[text] - **plot\_trees.** This method volumetric tree blocks along with the STL geometry.
%[text] - **convert\_fac\_to\_field**. This method converts a facet variable to a density in a 3D field, so it can be used for post-processing (e.g. calculating distributed drag). \
%[text] **The live matlab file of this tutorial can be found in the repository in the folder /docs/tutorial\_mlx.**
%[text] ## Initialising udbase
%[text] The starting point of this tutorial is that you have run a simulation and have merged the output files. If the simulations were performed on a HPC system, **we assume that you have copied the output directory to your own workstation**. Some of the netCDF (\*.nc) files may be very large and you may only want to copy these if you plan to analyse the data.
%[text] The uDALES postprocessing class is called `udbase`. Typically, you will create a post-processing script in the output directory on your workstation, but it is also possible to have the output directory located in another directory. This is particularly useful if you are comparing several different simulations at the same time. Here, we will show how to use data from simulation 065 (`expnr=065)` that is located in a different directory from the one you are working in.
%[text] **Note that the uDALES/tools/matlab path must be added via the Set Path button in order to use the udbase class. Alternatively, it can be added using the addpath function inside the script (done here).**
% preamble
clear variables
close all

% add the uDALES matlab path
% addpath('C:\Users\mvr\OneDrive - Imperial College London\codes\uDALES\u-dales\tools\matlab')
addpath('E:\uDALES\u-dales-enhance-udbase-udgeom-integration\tools\matlab')

% create an instance of the udbase class
% expnr = 065;
% expdir = 'C:\Users\mvr\OneDrive - Imperial College London\projects\2024_uDALES_sprint\udales-pp\experiments\065';
expnr = 065;
expdir = 'E:\uDALES\jh6016c\work\065';

sim = udbase(expnr, expdir);

%[text] The constructor can have a number of input parameters:
help udbase.udbase %[output:20648434]
%[text] The constructor of the `udbase` class reads in the following files:
%[text] - `namoptions.expnr. C`ontains the simulation input parameters.
%[text] - `xxx.stl.` Contains the urban geometry used for the simulation \[optional\].  \
%[text] Provided that `load_preprocdata` is not set to false, the constructor of the `udbase` class additionally reads the following files:
%[text] - `solid_(u,v,w,c).txt.` Contains the indices of the (u,v,w,c)-volumes occupied by buildings.
%[text] - `facets.inp`. Contains information about the facet wall type and surface normal.
%[text] - `factypes.inp`. Contains information about the properties of the wall types.
%[text] - `facetarea.inp`. Contains information about the facet areas.
%[text] - `fluid_boundary_(u,v,w,c).txt`. Contains information about the fluid cells associated with facet sections.
%[text] - `facet_sections_(u,v,w,c).txt`. Information about facet section area, distance and flux point. \
%%
%[text] ## Accessing simulation properties
%[text] To view all simulation input parameters, simply type
sim %[output:48085fde]
%[text] For a complete list of parameters and their meaning, please consult the pre-processing documentation. Some commonly used parameters are 
%[text] - `xlen`, `ylen` and `zsize` that represent the domain size
%[text] - `itot`, `jtot` and `ktot` that represent the total number of grid cells \
%[text] To access a parameter directly, use the syntax `object.prop`. To access the domain length in x-direction, use
sim.xlen %[output:1b489b15]
%[text] The geometry stored in the STL file, if present, has been also loaded, which can be visualised using the method below. This method will produce an error if STL file does not exist or been loaded.
sim.geom.show(); %[output:7f96d7aa]
%[text] This shows all individual faces. Use `show_outline` to see the building outlines.
sim.geom.show_outline(); %[output:5e700836]

